<!DOCTYPE html>
<html lang="en">
<head>
	<title>Cucumber</title>
	<meta content="text/html;charset=utf-8" http-equiv="Content-Type">
	<style>
.cucumber-react h1, .cucumber-react h2, .cucumber-react h3 {
  padding: 0;
  margin-top: 0.3em;
  margin-bottom: 0;
  display: inline-block;
}
.cucumber-react a {
  color: inherit;
}
.cucumber-react ol {
  list-style-type: none;
  padding-left: 10px;
}
.cucumber-react section {
  margin-bottom: 1em;
}
.cucumber-react .status-passed {
  color: #2CB14A;
}
.cucumber-react .status-skipped {
  color: #00A0CC;
}
.cucumber-react .status-pending {
  color: #FFAD33;
}
.cucumber-react .status-undefined {
  color: #FFAD33;
}
.cucumber-react .status-ambiguous {
  color: #F4EBFD;
}
.cucumber-react .status-failed {
  color: #BB0000;
}
.cucumber-react .status-unknown {
  color: #B6BECB;
}
.cucumber-react .data-table {
  border-collapse: collapse;
  margin-top: 0.5em;
  margin-bottom: 0.5em;
}
.cucumber-react .data-table th {
  border: 1px solid #4B5662;
  padding: 0.3em;
}
.cucumber-react .data-table td {
  border: 1px solid #4B5662;
  padding: 0.3em;
}
.cucumber-react .data-table td__status {
  padding: 0.5em 3px 3px 3px;
}
.cucumber-react .data-table td__step {
  flex-grow: 1;
}
.cucumber-react .examples-table {
  border-collapse: collapse;
  margin-top: 0.5em;
  margin-bottom: 0.5em;
}
.cucumber-react .examples-table th {
  padding: 0.3em;
}
.cucumber-react .examples-table th + th {
  border: 1px solid #4B5662;
}
.cucumber-react .examples-table td {
  padding: 0.3em;
}
.cucumber-react .examples-table td + td {
  border: 1px solid #4B5662;
}
.cucumber-react .examples-table td + td__status {
  padding: 0.5em 3px 3px 3px;
}
.cucumber-react .examples-table td + td__step {
  flex-grow: 1;
}
.cucumber-react .gherkin-document-list {
  font: 14px "Open Sans", sans-serif;
  color: #161C24;
  background: #fff;
  overflow-x: hidden;
}
.cucumber-react .indent {
  margin-left: 1em;
}
.cucumber-react .keyword {
  font-weight: bold;
}
.cucumber-react .step {
  padding: 0.1em;
}
.cucumber-react .step-text {
  font-weight: normal;
}
.cucumber-react .step-param {
  font-weight: normal;
}
.cucumber-react .step-container {
  display: flex;
}
.cucumber-react .step-container__step {
  flex-grow: 1;
}
.cucumber-react .text_status_icon_container {
  padding-top: 0.35em;
  padding-right: 0.5em;
}
.cucumber-react .error-message {
  padding: 0.5em;
  margin: 0;
  overflow: scroll;
}
.cucumber-react .tag-list {
  padding: 0;
  margin-bottom: 0;
}
.cucumber-react .tag {
  display: inline;
  list-style-type: none;
  padding: 4px 8px 4px 8px;
  margin-right: 6px;
  background-color: #FFFFFF;
  border-radius: 6px;
}
.cucumber-react p.cucumber-no-results {
  font: 14px "Open Sans", sans-serif;
}

.anchored-link {
  position: relative;
  display: flex;
  align-items: center;
  margin-top: 0.3em;
}
.anchored-link a {
  opacity: 0;
  transition: all 0.35s ease-in-out;
  position: absolute;
  left: -20px;
  display: flex;
  align-items: center;
}
.anchored-link:hover a {
  opacity: 1;
  width: max-content;
  transition: all 0.35s ease-in-out;
}
.anchored-link > * {
  height: 100%;
  margin-top: 0px;
}
.anchored-link h1, .anchored-link h2, .anchored-link h3 {
  margin-top: 0px;
}
.anchored-link .attachment {
  background-color: #ebebeb;
  padding: 0.5em;
}
.anchored-link .attachment .attachment-icon {
  margin-right: 0.5em;
}
.anchored-link .attachment-image {
  margin-top: 1em;
}
.anchored-link .highlight mark {
  background-color: yellow;
}
.anchored-link .cucumberFeature {
  padding-left: 10px;
}

.cucumber-report-header {
  width: 100%;
  display: grid;
  grid-template-columns: 1fr;
  border: 1px solid rgba(0, 0, 0, 0.1);
  font: 11px "Open Sans", sans-serif;
  margin-bottom: 1em;
}
.cucumber-report-header > * {
  padding: 1em;
}
.cucumber-report-header .cucumber-status-filter {
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
}
.cucumber-report-header .cucumber-status-filter table {
  width: 100%;
}
.cucumber-report-header .cucumber-execution-data {
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
}
.cucumber-report-header .cucumber-search-bar {
  border-right: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search {
  width: 100%;
  display: grid;
  grid-template-columns: 9fr 1fr;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search input {
  padding: 0.4em;
  border-radius: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search button {
  height: 2.2em;
  padding-left: 0.6em;
  padding-right: 0.6em;
}
.cucumber-report-header .cucumber-search-bar p.help {
  font-size: 80%;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul {
  display: inline;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li {
  list-style-type: none;
  display: inline-block;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li input {
  display: inline-block;
  width: auto;
  height: 0.6em;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li label {
  padding-right: 1em;
}

@media only screen and (min-width: 600px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: 1/-1;
  }
}
@media only screen and (min-width: 992px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr 2fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-execution-data {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: auto;
  }
}
.accordion {
    border: 1px solid rgba(0, 0, 0, 0.1);
    border-radius: 2px;
}

.accordion__item + .accordion__item {
    border-top: 1px solid rgba(0, 0, 0, 0.1);
}

.accordion__button {
    background-color: #f4f4f4;
    color: #444;
    cursor: pointer;
    padding: 10px;
    width: 100%;
    text-align: left;
    border: none;
}

.accordion__button:hover {
    background-color: #ddd;
}

.accordion__button:before {
    display: inline-block;
    content: '';
    height: 10px;
    width: 10px;
    margin-right: 12px;
    border-bottom: 2px solid currentColor;
    border-right: 2px solid currentColor;
    transform: rotate(-45deg);
}

.accordion__button[aria-expanded='true']::before,
.accordion__button[aria-selected='true']::before {
    transform: rotate(45deg);
}

.accordion__panel {
    padding: 20px;
    animation: fadein 0.35s ease-in;
}
